  return (
    <>
    <Header/>
    <Hero />
    <InView>
    {({ inView, ref, entry }) => (
      <div ref={ref}>
        <h2>{`Header inside viewport ${inView}.`}</h2>
        {console.log(entry.inView)}
      </div>
    )}
  </InView>
    <HomePortfolio />
    </>
  )
}
export default Home
